data:
  definition: avis envoyé automatiquement par le réseau à tout poste demandeur pour
    l'informer d'un nouveau numéro attribué au poste demandé, suivi soit d'un renvoi
    d'appel, soit de la libération du demandeur
  examples: []
  notes:
  - il est également possible de prévoir pour ce cas, un signal de service suivi de
    la libération.
